import React from 'react';
import Card from './Card';

function Hand({ cards = [], score, isDealer }) {
  return (
    <div className={isDealer ? 'dealer-hand' : 'player-hand'}>
      <h2>{isDealer ? 'Dealer' : 'Player'}</h2>
      <div className="cards">
        {cards && cards.map((card, index) => (
          <Card key={index} value={card.rank} suit={card.suit} />
        ))}
      </div>
      <div className="score">
        <span>{score}</span>
      </div>
    </div>
  );
}

export default Hand;
